syntax = "proto3";

package ManagerAccountCollection;

import "NavigationReference.proto";
import "Resource_v1/Oem.proto";

message ManagerAccountCollection {
    // from Resource.v1_0_0.ResourceCollection
    string Description = 1;
    string Name = 2;
    .Resource.Oem Oem = 3;

    // from ManagerAccountCollection.ManagerAccountCollection
    repeated NavigationReference Members = 4;
}